import { makeStyles } from "@material-ui/core/styles"

const styles = makeStyles(theme => ({
    home: {
        display: "flex",
        flexDirection: "column",
        justifyContent: "center",
        alignItems: "center",
        textAlign: "center",
        height: "100%",
        width: "100%"
    }
}))

export default styles
